class Solution {
    public boolean has_close_elements(List<Double> numbers, double threshold) {
        Collections.sort(numbers);
        for (int i = 0; i < numbers.size() - 1; i++) {
            double diff = Math.abs(numbers.get(i) - numbers.get(i + 1));
            if (diff < threshold) {
                return true;
            }
        }
        return false;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();

        // Test case 1
        List<Double> test1 = Arrays.asList(1.0, 2.0, 3.0);
        boolean result1 = sol.has_close_elements(test1, 0.5);
        System.out.println("Test1: " + (result1 == false ? "Passed" : "Failed"));

        // Test case 2
        List<Double> test2 = Arrays.asList(1.0, 2.8, 3.0, 4.0, 5.0, 2.0);
        boolean result2 = sol.has_close_elements(test2, 0.3);
        System.out.println("Test2: " + (result2 == true ? "Passed" : "Failed"));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.has_close_elements(new ArrayList<>(Arrays.asList(11.0, 2.0, 3.9, 4.0, 5.0, 2.2)), 0.3),
