class Solution {
    public boolean isPalindrome(String string) {
        int i = 0;
        int j = string.length() - 1;
        while (i < j) {
            if (string.charAt(i) != string.charAt(j)) {
                return false;
            }
            i++;
            j--;
        }
        return true;
    }

    public String make_palindrome(String string) {
        int n = string.length();
        if (n == 0) {
            return "";
        }
        int l;
        for (l = n; l >= 1; l--) {
            int start = n - l;
            String sub = string.substring(start, n);
            if (isPalindrome(sub)) {
                break;
            }
        }
        String prefix = string.substring(0, n - l);
        String reversed = new StringBuilder(prefix).reverse().toString();
        return string + reversed;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.make_palindrome(""));      // Output: ""
        System.out.println(sol.make_palindrome("cat"));   // Output: catac
        System.out.println(sol.make_palindrome("cata")); // Output: catac
        System.out.println(sol.make_palindrome("a"));     // Output: a
        System.out.println(sol.make_palindrome("aa"));    // Output: aa
        System.out.println(sol.make_palindrome("ab"));    // Output: aba
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.make_palindrome(""), ""),
                Objects.equals(s.make_palindrome("x"), "x"),
                Objects.equals(s.make_palindrome("xyz"), "xyzyx"),
                Objects.equals(s.make_palindrome("xyx"), "xyx"),
                Objects.equals(s.make_palindrome("jerry"), "jerryrrej")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

