class Solution {
    public Optional<String> longest(List<String> strings) {
        if (strings == null || strings.isEmpty()) {
            return Optional.empty();
        }
        String longestStr = "";
        int maxLength = -1;
        for (String str : strings) {
            if (str.length() > maxLength) {
                maxLength = str.length();
                longestStr = str;
            }
        }
        return Optional.of(longestStr);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test 1: Empty list should return Optional.empty
        List<String> emptyList = List.of();
        Optional<String> result = solution.longest(emptyList);
        System.out.println("Test 1: " + (result.isEmpty() ? "Passed" : "Failed"));

        // Test 2: All elements same length, return first
        List<String> sameLength = Arrays.asList("a", "b", "c");
        result = solution.longest(sameLength);
        System.out.println("Test 2: " + (result.equals(Optional.of("a")) ? "Passed" : "Failed"));

        // Test 3: One longest element
        List<String> oneLongest = Arrays.asList("a", "bb", "ccc");
        result = solution.longest(oneLongest);
        System.out.println("Test 3: " + (result.equals(Optional.of("ccc")) ? "Passed" : "Failed"));

        // Test 4: Multiple elements with max length, return first occurrence
        List<String> multipleMax = Arrays.asList("aa", "bb", "cc");
        result = solution.longest(multipleMax);
        System.out.println("Test 4: " + (result.equals(Optional.of("aa")) ? "Passed" : "Failed"));

        // Test 5: Single element
        List<String> singleElement = Collections.singletonList("hello");
        result = solution.longest(singleElement);
        System.out.println("Test 5: " + (result.equals(Optional.of("hello")) ? "Passed" : "Failed"));

        // Test 6: Multiple elements with same max length, check first occurrence
        List<String> multiMax = Arrays.asList("apple", "banana", "orange");
        result = solution.longest(multiMax);
        System.out.println("Test 6: " + (result.equals(Optional.of("banana")) ? "Passed" : "Failed"));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.longest(new ArrayList<>(List.of())).isEmpty(),
                Objects.equals(s.longest(new ArrayList<>(Arrays.asList("x", "y", "z"))).get(), "x"),
                Objects.equals(s.longest(new ArrayList<>(Arrays.asList("x", "yyy", "zzzz", "www", "kkkk", "abc"))).get(), "zzzz")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

