class Solution {
    public List<Integer> rolling_max(List<Integer> numbers) {
        List<Integer> result = new ArrayList<>();
        if (numbers.isEmpty()) {
            return result;
        }
        int currentMax = numbers.get(0);
        result.add(currentMax);
        for (int i = 1; i < numbers.size(); i++) {
            currentMax = Math.max(currentMax, numbers.get(i));
            result.add(currentMax);
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        testCase(solution, Arrays.asList(1, 2, 3, 2, 3, 4, 2), Arrays.asList(1, 2, 3, 3, 3, 4, 4));
        testCase(solution, Collections.emptyList(), Collections.emptyList());
        testCase(solution, Arrays.asList(5), Arrays.asList(5));
        testCase(solution, Arrays.asList(1, 3, 5, 7), Arrays.asList(1, 3, 5, 7));
        testCase(solution, Arrays.asList(5, 4, 3, 2), Arrays.asList(5, 5, 5, 5));
        testCase(solution, Arrays.asList(3, 1, 4, 2, 5), Arrays.asList(3, 3, 4, 4, 5));
    }

    private static void testCase(Solution solution, List<Integer> input, List<Integer> expected) {
        List<Integer> actual = solution.rolling_max(input);
        if (actual.equals(expected)) {
            System.out.println("Test passed for input: " + input);
        } else {
            System.out.println("Test failed for input: " + input);
            System.out.println("Expected: " + expected);
            System.out.println("Actual:   " + actual);
        }
    }
}

