class Solution {
    public int greatest_common_divisor(int a, int b) {
        a = Math.abs(a);
        b = Math.abs(b);
        while (b != 0) {
            int temp = b;
            b = a % b;
            a = temp;
        }
        return a;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        testCase(sol, 3, 5, 1);
        testCase(sol, 25, 15, 5);
        testCase(sol, 0, 5, 5);
        testCase(sol, 14, 28, 14);
        testCase(sol, -25, 15, 5);
        testCase(sol, 49, 21, 7);
    }

    private static void testCase(Solution sol, int a, int b, int expected) {
        int result = sol.greatest_common_divisor(a, b);
        if (result == expected) {
            System.out.println("Test (" + a + ", " + b + ") Passed");
        } else {
            System.out.println("Test (" + a + ", " + b + ") Failed. Expected: " + expected + ", Got: " + result);
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.greatest_common_divisor(3, 7) == 1,
                s.greatest_common_divisor(10, 15) == 5,
                s.greatest_common_divisor(49, 14) == 7,
                s.greatest_common_divisor(144, 60) == 12
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

