class Solution {
    public int count_distinct_characters(String string) {
        Set<Character> chars = new HashSet<>();
        String lowerStr = string.toLowerCase();
        for (int i = 0; i < lowerStr.length(); i++) {
            chars.add(lowerStr.charAt(i));
        }
        return chars.size();
    }

