class Solution {
    public int how_many_times(String string, String substring) {
        int count = 0;
        int subLen = substring.length();
        int strLen = string.length();

        if (subLen == 0) {
            return 0;
        }

        for (int i = 0; i <= strLen - subLen; i++) {
            if (string.substring(i, i + subLen).equals(substring)) {
                count++;
            }
        }
        return count;
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        // Test cases
        System.out.println(s.how_many_times("", "a")); // 0
        System.out.println(s.how_many_times("aaa", "a")); // 3
        System.out.println(s.how_many_times("aaaa", "aa")); // 3
        System.out.println(s.how_many_times("abababa", "aba")); // 3
        System.out.println(s.how_many_times("abc", "xyz")); // 0
        System.out.println(s.how_many_times("a", "a")); // 1
        System.out.println(s.how_many_times("aaab", "ab")); // 1
    }
}

