class Solution {
    public List<Integer> parse_music(String string) {
        List<Integer> beats = new ArrayList<>();
        if (string == null) {
            return beats;
        }
        String[] notes = string.split(" ");
        for (String note : notes) {
            switch (note) {
                case "o":
                    beats.add(4);
                    break;
                case "o|":
                    beats.add(2);
                    break;
                case ".|":
                    beats.add(1);
                    break;
            }
        }
        return beats;
    }

