class Solution {
    public String sort_numbers(String numbers) {
        // Create a map from number words to their corresponding values
        Map<String, Integer> wordToNumber = new HashMap<>();
        wordToNumber.put("zero", 0);
        wordToNumber.put("one", 1);
        wordToNumber.put("two", 2);
        wordToNumber.put("three", 3);
        wordToNumber.put("four", 4);
        wordToNumber.put("five", 5);
        wordToNumber.put("six", 6);
        wordToNumber.put("seven", 7);
        wordToNumber.put("eight", 8);
        wordToNumber.put("nine", 9);

        // Split the input string into individual words
        String[] words = numbers.split(" ");

        // Convert words to their numerical values and sort them
        List<Integer> nums = new ArrayList<>();
        for (String word : words) {
            nums.add(wordToNumber.get(word));
        }
        Collections.sort(nums);

        // Create a reverse map from numbers to words
        Map<Integer, String> numberToWord = new HashMap<>();
        for (Map.Entry<String, Integer> entry : wordToNumber.entrySet()) {
            numberToWord.put(entry.getValue(), entry.getKey());
        }

        // Convert sorted numbers back to words
        List<String> sortedWords = new ArrayList<>();
        for (int num : nums) {
            sortedWords.add(numberToWord.get(num));
        }

        // Join the sorted words into a single string
        return String.join(" ", sortedWords);
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        testCase(sol, "three one five", "one three five");
        testCase(sol, "zero two four", "zero two four");
        testCase(sol, "nine seven five", "five seven nine");
        testCase(sol, "one one three", "one one three");
        testCase(sol, "four", "four");
        testCase(sol, "nine eight seven six five four three two one zero", "zero one two three four five six seven eight nine");
    }

    private static void testCase(Solution sol, String input, String expected) {
        String result = sol.sort_numbers(input);
        if (expected.equals(result)) {
            System.out.println("Test passed for input: '" + input + "'");
        } else {
            System.out.println("Test FAILED for input: '" + input + "'");
            System.out.println("  Expected: '" + expected + "'");
            System.out.println("  Actual  : '" + result + "'");
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.sort_numbers("").equals(""),
                s.sort_numbers("three").equals("three"),
                s.sort_numbers("three five nine").equals("three five nine"),
                s.sort_numbers("five zero four seven nine eight").equals("zero four five seven eight nine")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

