class Solution {
    public int largest_divisor(int n) {
        if (n == 1) {
            return 0;
        }
        for (int i = n - 1; i > 0; i--) {
            if (n % i == 0) {
                return i;
            }
        }
        return 0; // This line is theoretically unreachable for n > 1
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        // Test cases
        System.out.println("Test 15: " + (s.largest_divisor(15) == 5 ? "Pass" : "Fail"));
