class Solution {
    public List<Integer> factorize(int n) {
        List<Integer> factors = new ArrayList<>();
        if (n <= 1) {
            return factors;
        }
        // Check divisibility starting from 2
        int divisor = 2;
        while (n > 1) {
            while (n % divisor == 0) {
                factors.add(divisor);
                n /= divisor;
            }
            divisor++;
            // If divisor^2 exceeds n and n is still greater than 1, then n is a prime
            if (divisor * divisor > n && n > 1) {
                factors.add(n);
                break;
            }
        }
        return factors;
    }

    public static void main(String[] args) {
        testFactorize(8, Arrays.asList(2, 2, 2));
        testFactorize(25, Arrays.asList(5, 5));
        testFactorize(70, Arrays.asList(2, 5, 7));
        testFactorize(1, new ArrayList<>());
        testFactorize(2, Collections.singletonList(2));
        testFactorize(4, Arrays.asList(2, 2));
        testFactorize(12, Arrays.asList(2, 2, 3));
        testFactorize(3, Collections.singletonList(3));
        testFactorize(17, Collections.singletonList(17));
        testFactorize(100, Arrays.asList(2, 2, 5, 5));
    }

    private static void testFactorize(int n, List<Integer> expected) {
        Solution sol = new Solution();
        List<Integer> actual = sol.factorize(n);
        if (actual.equals(expected)) {
            System.out.println("Test passed for " + n);
        } else {
            System.out.println("Test failed for " + n + ". Expected " + expected + " but got " + actual);
        }
    }
}

