class Solution {
    public List<Integer> sort_third(List<Integer> l) {
        List<Integer> indicesDivisibleByThree = new ArrayList<>();
        List<Integer> values = new ArrayList<>();

        // Collect indices divisible by three and their corresponding values
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                indicesDivisibleByThree.add(i);
                values.add(l.get(i));
            }
        }

        // Sort the collected values
        Collections.sort(values);

        // Create a new list to avoid modifying the original list while iterating
        List<Integer> result = new ArrayList<>(l);

        // Replace the values at the indices divisible by three with the sorted values
        for (int i = 0; i < indicesDivisibleByThree.size(); i++) {
            int index = indicesDivisibleByThree.get(i);
            result.set(index, values.get(i));
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<Integer> input1 = Arrays.asList(1, 2, 3);
