class Solution {
    public int fizz_buzz(int n) {
        int total = 0;
        for (int i = 1; i < n; i++) {
            if (i % 11 == 0 || i % 13 == 0) {
                total += countSevens(i);
            }
        }
        return total;
    }

    private int countSevens(int num) {
        int count = 0;
        while (num > 0) {
            int digit = num % 10;
            if (digit == 7) {
                count++;
            }
            num /= 10;
        }
        return count;
    }
}

