class Solution {
    /**
     * Returns the decoded string which was encoded with encodeCyclic function.
     */
    public String decode_cyclic(String s) {
        List<String> groups = new ArrayList<>();
        for (int i = 0; i < s.length(); i += 3) {
            groups.add(s.substring(i, Math.min(i + 3, s.length())));
        }
        for (int i = 0; i < groups.size(); i++) {
            String group = groups.get(i);
            if (group.length() == 3) {
                char lastChar = group.charAt(2);
                groups.set(i, lastChar + group.substring(0, 2));
            }
        }
        return String.join("", groups);
    }
}

