class Solution {
    public int prime_fib(int n) {
        int count = 0;
        int a = 0, b = 1;
        while (true) {
            int c = a + b;
            a = b;
            b = c;
            if (isPrime(b)) {
                count++;
                if (count == n) {
                    return b;
                }
            }
        }
    }

    private boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }
        if (num <= 3) {
            return true;
        }
        if (num % 2 == 0 || num % 3 == 0) {
            return false;
        }
        int i = 5;
        int w = 2;
        while (i * i <= num) {
            if (num % i == 0) {
                return false;
            }
            i += w;
            w = 6 - w;
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        testCase(solution, 1, 2);
        testCase(solution, 2, 3);
        testCase(solution, 3, 5);
        testCase(solution, 4, 13);
        testCase(solution, 5, 89);
        System.out.println("All test cases passed!");
    }

    private static void testCase(Solution s, int input, int expected) {
        int result = s.prime_fib(input);
        if (result != expected) {
            System.err.println("Test failed for input " + input + ": Expected " + expected + ", got " + result);
            System.exit(1);
        }
    }
}

