class Solution {
    public int fib4(int n) {
        if (n == 0 || n == 1 || n == 3) {
            return 0;
        } else if (n == 2) {
            return 2;
        }
        int a = 0, b = 0, c = 2, d = 0;
        for (int i = 4; i <= n; i++) {
            int current = a + b + c + d;
            a = b;
            b = c;
            c = d;
            d = current;
        }
        return d;
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        System.out.println(s.fib4(5));  // Expected 4
        System.out.println(s.fib4(6));  // Expected 8
        System.out.println(s.fib4(7));  // Expected 14
        System.out.println(s.fib4(0));  // 0
        System.out.println(s.fib4(2));  // 2
        System.out.println(s.fib4(3));  // 0
        System.out.println(s.fib4(4));  // 2
