class Solution {
    public String encodeShift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            sb.append((char) ('a' + ((ch + 5 - 'a') % 26)));
        }
        return sb.toString();
    }

    public String decode_shift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            int shifted = (ch - 'a' + 21) % 26;
            sb.append((char) ('a' + shifted));
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        // Test case 1: Basic test
        String original = "abc";
        String encoded = sol.encodeShift(original);
        String decoded = sol.decode_shift(encoded);
        System.out.println("Original: " + original + ", Encoded: " + encoded + ", Decoded: " + decoded);

        // Test case 2: Wrap around characters
        original = "xyz";
        encoded = sol.encodeShift(original);
