import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
class Solution {
    public int modp(int n, int p) {
        if (p == 1) {
            return 0;
        }
        long result = 1;
        long base = 2 % p;
        int exponent = n;
        while (exponent > 0) {
            if ((exponent & 1) != 0) {
                result = (result * base) % p;
            }
            base = (base * base) % p;
            exponent >>= 1;
        }
        return (int) result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println("Test 1: " + (solution.modp(3, 5) == 3 ? "Passed" : "Failed"));
        System.out.println("Test 2: " + (solution.modp(1101, 101) == 2 ? "Passed" : "Failed"));
        System.out.println("Test 3: " + (solution.modp(0, 101) == 1 ? "Passed" : "Failed"));
        System.out.println("Test 4: " + (solution.modp(3, 11) == 8 ? "Passed" : "Failed"));
        System.out.println("Test 5: " + (solution.modp(100, 101) == 1 ? "Passed" : "Failed"));
    }
}

