class Solution {
    public int largest_prime_factor(int n) {
        int largestFactor = -1;
        // Check divisibility by 2 first
        while (n % 2 == 0) {
            largestFactor = 2;
            n /= 2;
        }
        // Now check odd numbers starting from 3
        for (int i = 3; i <= Math.sqrt(n); i += 2) {
            while (n % i == 0) {
                largestFactor = i;
                n /= i;
            }
        }
        // If remaining n is a prime greater than 2
        if (n > 2) {
            largestFactor = n;
        }
        return largestFactor;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        // Test case 1: n = 13195, expected 29
        int result1 = solution.largest_prime_factor(13195);
