class Solution {
    public boolean monotonic(List<Integer> l) {
        if (l.size() <= 2) return true;

        int direction = 0; // 0: undetermined, 1: increasing, -1: decreasing

        for (int i = 0; i < l.size() - 1; i++) {
            int current = l.get(i);
            int next = l.get(i + 1);

            if (direction == 0) {
                if (next > current) {
                    direction = 1;
                } else if (next < current) {
                    direction = -1;
                }
                // else, remain undetermined if elements are equal
            }

            if (direction == 1) {
                if (next < current) return false;
            } else if (direction == -1) {
                if (next > current) return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        Solution s = new Solution();

        // Test case 1: Monotonically increasing
        List<Integer> test1 = Arrays.asList(1, 2, 4, 20);
        System.out.println(s.monotonic(test1)); // true

        // Test case 2: Not monotonic
        List<Integer> test2 = Arrays.asList(1, 20, 4, 10);
        System.out.println(s.monotonic(test2)); // false

        // Test case 3: Monotonically decreasing
        List<Integer> test3 = Arrays.asList(4, 1, 0, -10);
        System.out.println(s.monotonic(test3)); // true

        // Additional test case: All elements equal
        List<Integer> test4 = Arrays.asList(5, 5, 5);
        System.out.println(s.monotonic(test4)); // true

        // Additional test case: Initially flat then increasing
        List<Integer> test5 = Arrays.asList(2, 2, 3, 4);
        System.out.println(s.monotonic(test5)); // true

        // Additional test case: Initially flat then decreasing
        List<Integer> test6 = Arrays.asList(4, 4, 3, 2);
        System.out.println(s.monotonic(test6)); // true
    }
}

