import java.lang.*;
class Solution {
    public int fibfib(int n) {
        if (n == 0 || n == 1) {
            return 0;
        } else if (n == 2) {
            return 1;
        }
        int a = 0, b = 0, c = 1;
        for (int i = 3; i <= n; i++) {
            int next = a + b + c;
            a = b;
            b = c;
            c = next;
        }
        return c;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.fibfib(1));  // Expected 0
        System.out.println(sol.fibfib(5));  // Expected 4
        System.out.println(sol.fibfib(8));  // Expected 24
    }
}

