class Solution {
    public int vowels_count(String s) {
        int count = 0;
        if (s == null || s.isEmpty()) {
            return 0;
        }
        String lowerS = s.toLowerCase();
        int length = lowerS.length();
        for (int i = 0; i < length; i++) {
            char c = lowerS.charAt(i);
            if (i == length - 1) {
                // Check for vowels including 'y' at the end
                if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u' || c == 'y') {
                    count++;
                }
            } else {
                // Check for vowels excluding 'y' for non-last characters
                if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
                    count++;
                }
            }
        }
        return count;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.vowels_count("abcde"));    // Expected: 2
        System.out.println(sol.vowels_count("ACEDY"));    // Expected: 3
        System.out.println(sol.vowels_count("y"));        // Expected: 1
        System.out.println(sol.vowels_count("yy"));       // Expected: 1
        System.out.println(sol.vowels_count("appleY"));   // Expected: 3
        System.out.println(sol.vowels_count("yummy"));    // Expected: 2
        System.out.println(sol.vowels_count(""));         // Expected: 0
        System.out.println(sol.vowels_count("AEIOUY"));   // Expected: 6
    }
}

