class Solution {
    public String circular_shift(int x, int shift) {
        String s = Integer.toString(x);
        int n = s.length();
        if (n == 0) return "";

        if (shift > n) {
            return new StringBuilder(s).reverse().toString();
        } else {
            int splitPos = n - shift;
            return s.substring(splitPos) + s.substring(0, splitPos);
        }
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        assertTest(sol.circular_shift(12, 1), "21");
        assertTest(sol.circular_shift(12, 2), "12");
        assertTest(sol.circular_shift(123, 1), "312");
        assertTest(sol.circular_shift(123, 2), "231");
        assertTest(sol.circular_shift(123, 3), "123");
        assertTest(sol.circular_shift(123, 4), "321");
        assertTest(sol.circular_shift(10, 1), "01");
        assertTest(sol.circular_shift(0, 0), "0");
        assertTest(sol.circular_shift(0, 5), "0");
        assertTest(sol.circular_shift(100, 2), "001");
    }

    private static void assertTest(String actual, String expected) {
