class Solution {
    public boolean is_multiply_prime(int a) {
        List<Integer> primes = generatePrimesUnder100();
        for (int p1 : primes) {
            for (int p2 : primes) {
                for (int p3 : primes) {
                    if (p1 * p2 * p3 == a) {
                        return true;
                    }
                }
            }
        }
        return false;
    }

    private List<Integer> generatePrimesUnder100() {
        boolean[] isPrime = new boolean[100];
        Arrays.fill(isPrime, true);
        isPrime[0] = false;
        isPrime[1] = false;
        for (int i = 2; i * i < 100; i++) {
            if (isPrime[i]) {
                for (int j = i * i; j < 100; j += i) {
                    isPrime[j] = false;
                }
            }
        }
        List<Integer> primes = new ArrayList<>();
        for (int i = 2; i < 100; i++) {
            if (isPrime[i]) {
                primes.add(i);
            }
        }
        return primes;
    }
}

