class Solution {
    public int smallest_change(List<Integer> arr) {
        int count = 0;
        int n = arr.size();
        for (int i = 0; i < n / 2; i++) {
            int left = arr.get(i);
            int right = arr.get(n - 1 - i);
            if (left != right) {
                count++;
            }
        }
        return count;
    }
}

