class Solution {
    public List<Integer> pluck(List<Integer> arr) {
        if (arr.isEmpty()) {
            return new ArrayList<>();
        }

        int minEven = Integer.MAX_VALUE;
        int minIndex = -1;

        for (int i = 0; i < arr.size(); i++) {
            int num = arr.get(i);
            if (num % 2 == 0) {
                if (num < minEven) {
                    minEven = num;
                    minIndex = i;
                    // Early exit if we find 0, since it's the smallest possible even number
                    if (minEven == 0) {
                        break;
                    }
                }
            }
        }

        if (minIndex == -1) {
            return new ArrayList<>();
        } else {
            return Arrays.asList(minEven, minIndex);
        }
    }

    public static void main(String[] args) {
