class Solution {
    public boolean will_it_fly(List<Integer> q, int w) {
        // Calculate the sum of elements in the list
        int sum = 0;
        for (int num : q) {
            sum += num;
        }
        // Check if sum exceeds the maximum weight
        if (sum > w) {
            return false;
        }
        // Check if the list is a palindrome
        int left = 0;
        int right = q.size() - 1;
        while (left < right) {
            if (!q.get(left).equals(q.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }
}

