class Solution {
    public boolean is_simple_power(int x, int n) {
        // Handle x == 0 case
        if (x == 0) {
            return (n == 0);
        }
        // Handle n == 0 case (since x is not 0 here)
        if (n == 0) {
            return false;
        }
        // Handle x == 1 case
        if (x == 1) {
            return (n != 0);
        }
        // Handle n == 1 case
        if (n == 1) {
            return (x == 1);
        }

        int current = x;
        while (current % n == 0) {
            current = current / n;
            if (current == 1) {
                return true;
            }
        }
        return current == 1;
    }
}

