class Solution {
    public List<Integer> strange_sort_list(List<Integer> lst) {
        List<Integer> result = new ArrayList<>();
        if (lst.isEmpty()) {
            return result;
        }

        List<Integer> sorted = new ArrayList<>(lst);
        Collections.sort(sorted);

        int left = 0;
        int right = sorted.size() - 1;
        boolean pickMin = true;

        while (left <= right) {
            if (pickMin) {
                result.add(sorted.get(left));
                left++;
            } else {
                result.add(sorted.get(right));
                right--;
            }
            pickMin = !pickMin;
        }

        return result;
    }

    public static void main(String[] args) {
