class Solution {
    public int hex_key(String num) {
        Set<Integer> primes = new HashSet<>(Arrays.asList(2, 3, 5, 7, 11, 13));
        int count = 0;
        for (char c : num.toCharArray()) {
            int value;
            if (Character.isDigit(c)) {
                value = c - '0';
            } else {
                value = 10 + (c - 'A');
            }
            if (primes.contains(value)) {
                count++;
            }
        }
        return count;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.hex_key("AB")); // Expected output: 1
        System.out.println(sol.hex_key("1077E")); // Expected output: 2
        System.out.println(sol.hex_key("ABED1A33")); // Expected output: 4
        System.out.println(sol.hex_key("123456789ABCDEF0")); // Expected output: 6
        System.out.println(sol.hex_key("2020")); // Expected output: 2
    }
}

