class Solution {
    public boolean prime_length(String string) {
        int len = string.length();
        return isPrime(len);
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n == 2) {
            return true;
        }
        if (n % 2 == 0) {
            return false;
        }
        for (int i = 3; i * i <= n; i += 2) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        System.out.println(s.prime_length("Hello"));     // true
        System.out.println(s.prime_length("abcdcba"));   // true
        System.out.println(s.prime_length("kittens"));    // true
        System.out.println(s.prime_length("orange"));    // false
    }
}

