class Solution {
    public int starts_one_ends(int n) {
        if (n == 0) return 0; // Handles invalid case, though n is positive as per problem statement
        int start = (int) Math.pow(10, n - 1);
        int end = (n == 1) ? 1 : 9 * (int) Math.pow(10, n - 2);
        int overlap = (n == 1) ? 1 : (int) Math.pow(10, n - 2);
        return start + end - overlap;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.starts_one_ends(1));  // Output: 1
        System.out.println(sol.starts_one_ends(2));  // Output: 18
