import java.util.regex.Matcher;

class Solution {
    public String anti_shuffle(String s) {
        List<String> tokens = new ArrayList<>();
        Pattern pattern = Pattern.compile("\\s+|\\S+");
        Matcher matcher = pattern.matcher(s);
        while (matcher.find()) {
            tokens.add(matcher.group());
        }
        StringBuilder sb = new StringBuilder();
        for (String token : tokens) {
            if (token.length() > 0 && token.charAt(0) != ' ') {
                char[] chars = token.toCharArray();
                Arrays.sort(chars);
                sb.append(new String(chars));
            } else {
                sb.append(token);
            }
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        testCase(sol, "Hi", "Hi");
        testCase(sol, "hello", "ehllo");
        testCase(sol, "Hello World!!!", "Hello !!!Wdlor");
        testCase(sol, "   Hi  there  ", "   Hi  eehrt  ");
        testCase(sol, "a b c", "a b c");
        testCase(sol, "AbCdE", "ACEbd");
        testCase(sol, "", "");
        testCase(sol, "   ", "   ");
    }

    private static void testCase(Solution sol, String input, String expected) {
        String result = sol.anti_shuffle(input);
        System.out.printf("Input: '%s'%nExpected: '%s'%nResult: '%s'%n%n", input, expected, result);
        if (!result.equals(expected)) {
            System.out.println("Test failed!");
        }
    }
}

