class Solution {
    public List<Integer> sort_array(List<Integer> array) {
        List<Integer> copy = new ArrayList<>(array);
        int size = copy.size();
        if (size <= 1) {
            return copy;
        }
        int first = copy.get(0);
        int last = copy.get(size - 1);
        int sum = first + last;
        if (sum % 2 == 1) {
            Collections.sort(copy);
        } else {
            Collections.sort(copy, Collections.reverseOrder());
        }
        return copy;
    }
}

