class Solution {
    public int is_bored(String S) {
        int count = 0;
        String[] sentences = S.split("[.!?]+");
        for (String sentence : sentences) {
            String trimmed = sentence.trim();
            if (trimmed.isEmpty()) {
                continue;
            }
            String[] words = trimmed.split("\\s+");
            if (words.length > 0 && words[0].equals("I")) {
                count++;
            }
        }
        return count;
    }
