class Solution {
    public boolean any_int(Object x, Object y, Object z) {
        // Check if all inputs are Integers
        if (!(x instanceof Integer) || !(y instanceof Integer) || !(z instanceof Integer)) {
            return false;
        }

        // Cast to primitive int types
        int a = (Integer) x;
        int b = (Integer) y;
        int c = (Integer) z;

        // Check if any one is the sum of the other two
        return a == b + c || b == a + c || c == a + b;
    }
}

