class Solution {
    public String encode(String message) {
        if (message == null || message.isEmpty()) {
            return message;
        }
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < message.length(); i++) {
            char c = message.charAt(i);
            // Swap the case of the character
            char swapped = Character.isUpperCase(c) ? Character.toLowerCase(c) : Character.toUpperCase(c);
            // Check if the swapped character is a vowel
            if (isVowel(swapped)) {
                sb.append((char) (swapped + 2));
            } else {
                sb.append(swapped);
            }
        }
        return sb.toString();
    }

    private boolean isVowel(char c) {
        char lowerC = Character.toLowerCase(c);
        return lowerC == 'a' || lowerC == 'e' || lowerC == 'i' || lowerC == 'o' || lowerC == 'u';
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        // Test case 1
        String input1 = "test";
        String expected1 = "TGST";
        String result1 = solution.encode(input1);
        System.out.println("Test 1: " + (expected1.equals(result1) ? "Passed" : "Failed"));
        // Test case 2
        String input2 = "This is a message";
        String expected2 = "tHKS KS C MGSSCGG";
        String result2 = solution.encode(input2);
        System.out.println("Test 2: " + (expected2.equals(result2) ? "Passed" : "Failed"));
    }
}

