class Solution {
    public boolean check_dict_case(Map<Object, Object> dict) {
        // Check if the map is empty
        if (dict.isEmpty()) {
            return false;
        }

        // Check all keys are instances of String
        for (Object key : dict.keySet()) {
            if (!(key instanceof String)) {
                return false;
            }
        }

        // Get the first key to determine the required case
        String firstKey = (String) dict.keySet().iterator().next();
        boolean isFirstLower = firstKey.equals(firstKey.toLowerCase());
        boolean isFirstUpper = firstKey.equals(firstKey.toUpperCase());

        // If the first key is neither all lower nor all upper, return false
        if (!isFirstLower && !isFirstUpper) {
            return false;
        }

        boolean requireLower = isFirstLower;

        // Check all keys match the required case
        for (Object keyObj : dict.keySet()) {
            String key = (String) keyObj;
            if (requireLower) {
                if (!key.equals(key.toLowerCase())) {
                    return false;
                }
            } else {
                if (!key.equals(key.toUpperCase())) {
                    return false;
                }
            }
        }

        return true;
    }
}

