class Solution {
    public List<Integer> count_up_to(int n) {
        List<Integer> primes = new ArrayList<>();
        if (n <= 2) {
            return primes;
        }
        boolean[] isPrime = new boolean[n];
        Arrays.fill(isPrime, true);
        isPrime[0] = false;
        isPrime[1] = false;
        for (int i = 2; i * i < n; i++) {
            if (isPrime[i]) {
                for (int j = i * i; j < n; j += i) {
                    isPrime[j] = false;
                }
            }
        }
        for (int i = 2; i < n; i++) {
            if (isPrime[i]) {
                primes.add(i);
            }
        }
        return primes;
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        System.out.println(s.count_up_to(5));   // [2, 3]
        System.out.println(s.count_up_to(11));  // [2, 3, 5, 7]
        System.out.println(s.count_up_to(0));   // []
        System.out.println(s.count_up_to(20));  // [2, 3, 5, 7, 11, 13, 17, 19]
        System.out.println(s.count_up_to(1));   // []
        System.out.println(s.count_up_to(18));  // [2, 3, 5, 7, 11, 13, 17]
    }
}

