class Solution {
    public List<Integer> make_a_pile(int n) {
        List<Integer> result = new ArrayList<>();
        if (n <= 0) {
            return result; // return empty list for non-positive n as per problem statement
        }
        int current = n;
        result.add(current);
        for (int i = 1; i < n; i++) {
            if (current % 2 == 0) {
                current += 2; // next even number
            } else {
                current += 1; // next odd number (since adding 1 to odd gives even, then add another 1)
                current += 1;
            }
            result.add(current);
        }
        return result;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        testCase(sol, 3, Arrays.asList(3, 5, 7));
        testCase(sol, 2, Arrays.asList(2, 4));
