        testCase(sol, 4, Arrays.asList(4, 6, 8, 10));
        testCase(sol, 5, Arrays.asList(5, 7, 9, 11, 13));
    }

    private static void testCase(Solution sol, int n, List<Integer> expected) {
        List<Integer> actual = sol.make_a_pile(n);
        boolean isCorrect = actual.equals(expected);
        System.out.println("Test for n=" + n + ": " + (isCorrect ? "PASSED" : "FAILED"));
        if (!isCorrect) {
            System.out.println("Expected: " + expected);
            System.out.println("Actual:   " + actual);
        }
    }
