class Solution {
    public Object rounded_avg(int n, int m) {
        if (n > m) {
            return -1;
        }
        long sum = (long) (m + n) * (m - n + 1) / 2;
        long average = sum / (m - n + 1);
        // Since the numbers are consecutive, the average is either an integer or exactly halfway between two integers.
        // However, due to integer division, sum/(count) already gives the floored average. But since sum is (n + m) * count / 2,
        // the average is (n + m)/2.0. So if (n + m) is even, average is integer; else, it's .5.
        // So rounding to nearest is (n + m + 1) / 2.
        long rounded = (n + m + 1) / 2;
        return Long.toBinaryString(rounded);
    }

    public static void main(String[] args) {
