class Solution {
    public List<Integer> f(int n) {
        List<Integer> result = new ArrayList<>();
        for (int i = 1; i <= n; i++) {
            if (i % 2 == 0) {
                int factorial = 1;
                for (int j = 1; j <= i; j++) {
                    factorial *= j;
                }
                result.add(factorial);
            } else {
                int sum = i * (i + 1) / 2;
                result.add(sum);
            }
        }
        return result;
    }

