class Solution {
    public List<Integer> even_odd_palindrome(int n) {
        int evenCount = 0;
        int oddCount = 0;
        for (int i = 1; i <= n; i++) {
            if (isPalindrome(i)) {
                if (i % 2 == 0) {
                    evenCount++;
                } else {
                    oddCount++;
                }
            }
        }
        List<Integer> result = new ArrayList<>();
        result.add(evenCount);
        result.add(oddCount);
        return result;
    }

    private boolean isPalindrome(int num) {
        int reversed = 0;
        int original = num;
        while (num > 0) {
            reversed = reversed * 10 + num % 10;
            num /= 10;
        }
        return original == reversed;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();

        // Test case 1
        int input1 = 3;
        List<Integer> output1 = sol.even_odd_palindrome(input1);
        System.out.println("Test case 1: " + output1); // Expected [1, 2]

