        System.out.println("Test case 2: " + output2); // Expected [4, 6]

        // Test case 3: n = 1
        int input3 = 1;
        List<Integer> output3 = sol.even_odd_palindrome(input3);
        System.out.println("Test case 3: " + output3); // Expected [0, 1]

        // Test case 4: n = 2
        int input4 = 2;
        List<Integer> output4 = sol.even_odd_palindrome(input4);
        System.out.println("Test case 4: " + output4); // Expected [1, 1]

        // Test case 5: n = 11
