class Solution {
    public List<String> by_length(List<Integer> arr) {
        // Filter the valid numbers (1-9 inclusive)
        List<Integer> filtered = arr.stream()
            .filter(num -> num >= 1 && num <= 9)
            .collect(Collectors.toList());

        // Sort the filtered list in natural order (ascending)
        Collections.sort(filtered);

        // Reverse the sorted list to get descending order
        Collections.reverse(filtered);

        // Map each number to its corresponding name
        String[] names = {"One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"};
        List<String> result = new ArrayList<>();
        for (int num : filtered) {
            result.add(names[num - 1]);
        }

        return result;
    }

