class Solution {
    public int count_nums(List<Integer> arr) {
        int count = 0;
        for (int num : arr) {
            int sum = sumDigits(num);
            if (sum > 0) {
                count++;
            }
        }
        return count;
    }

    private int sumDigits(int num) {
        if (num == 0) {
            return 0;
        }
        String s = Integer.toString(num);
        boolean isNegative = s.charAt(0) == '-';
        int startIndex = isNegative ? 1 : 0;
        int sum = 0;
        for (int i = startIndex; i < s.length(); i++) {
            char c = s.charAt(i);
            int digit = Character.getNumericValue(c);
            if (i == startIndex && isNegative) {
                digit = -digit;
            }
            sum += digit;
        }
        return sum;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        // Test case 1: empty list
        System.out.println(sol.count_nums(new ArrayList<>()) == 0); // true
        // Test case 2: [-1, 11, -11]
        List<Integer> test2 = Arrays.asList(-1, 11, -11);
        System.out.println(sol.count_nums(test2) == 1); // true
        // Test case 3: [1, 1, 2]
        List<Integer> test3 = Arrays.asList(1, 1, 2);
        System.out.println(sol.count_nums(test3) == 3); // true
    }
}

