class Solution {
    public boolean move_one_ball(List<Integer> arr) {
        if (arr.isEmpty()) {
            return true;
        }

        List<Integer> sorted = new ArrayList<>(arr);
        Collections.sort(sorted);

        if (arr.equals(sorted)) {
            return true;
        }

        // Check if arr is a rotation of the sorted array
        List<Integer> concatenated = new ArrayList<>(sorted);
        concatenated.addAll(sorted);

        int n = sorted.size();
        for (int i = 1; i < n; i++) {
            List<Integer> sublist = concatenated.subList(i, i + n);
            if (sublist.equals(arr)) {
                return true;
            }
        }

        return false;
    }

    // Test cases
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.move_one_ball(Arrays.asList(3, 4, 5, 1, 2)));  // true
        System.out.println(solution.move_one_ball(Arrays.asList(3, 5, 4, 1, 2)));  // false
        System.out.println(solution.move_one_ball(Collections.emptyList()));       // true
        System.out.println(solution.move_one_ball(Arrays.asList(1)));             // true
        System.out.println(solution.move_one_ball(Arrays.asList(2, 1)));          // true
        System.out.println(solution.move_one_ball(Arrays.asList(1, 2, 3)));      // true
        System.out.println(solution.move_one_ball(Arrays.asList(4, 5, 1, 2, 3))); // true
        System.out.println(solution.move_one_ball(Arrays.asList(5, 4, 3, 2, 1))); // false
    }
}

