class Solution {
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int even1 = 0;
        for (int num : lst1) {
            if (num % 2 == 0) {
                even1++;
            }
        }
        int even2 = 0;
        for (int num : lst2) {
            if (num % 2 == 0) {
                even2++;
            }
        }
        return (even1 + even2) >= lst1.size() ? "YES" : "NO";
    }
}

