class Solution {
    public List<Object> reverse_delete(String s, String c) {
        Set<Character> toDelete = new HashSet<>();
        for (int i = 0; i < c.length(); i++) {
            toDelete.add(c.charAt(i));
        }

        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            if (!toDelete.contains(ch)) {
                sb.append(ch);
            }
        }
        String filtered = sb.toString();

        String reversed = new StringBuilder(filtered).reverse().toString();
        boolean isPalindrome = filtered.equals(reversed);

        return Arrays.asList(filtered, isPalindrome);
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        // Test cases
        System.out.println(sol.reverse_delete("abcde", "ae"));    // ["bcd", false]
