        // Test case 5
        System.out.println(sol.select_words("Uncle sam", 3));               // ["Uncle"]

        // Additional test case for uppercase consonants
        System.out.println(sol.select_words("HELLO WORLD", 4));            // ["WORLD"]

        // Test case with Y as consonant
