class Solution {
    public String get_closest_vowel(String word) {
        int n = word.length();
        if (n < 3) {
            return "";
        }
        for (int i = n - 2; i >= 1; i--) {
            char c = word.charAt(i);
            if (isVowel(c)) {
                char prev = word.charAt(i - 1);
                char next = word.charAt(i + 1);
                if (!isVowel(prev) && !isVowel(next)) {
                    return String.valueOf(c);
                }
            }
        }
        return "";
    }

    private boolean isVowel(char c) {
        return "aeiouAEIOU".indexOf(c) != -1;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.get_closest_vowel("yogurt"));    // "u"
        System.out.println(sol.get_closest_vowel("FULL"));      // "U"
        System.out.println(sol.get_closest_vowel("quick"));     // ""
        System.out.println(sol.get_closest_vowel("ab"));        // ""
        System.out.println(sol.get_closest_vowel("cac"));       // "a"
        System.out.println(sol.get_closest_vowel("xEyz"));      // "E"
    }
}

