class Solution {
    public String match_parens(List<String> lst) {
        String s1 = lst.get(0);
        String s2 = lst.get(1);

        int open1 = countOpen(s1);
        int close1 = s1.length() - open1;
        int open2 = countOpen(s2);
        int close2 = s2.length() - open2;

        int totalOpen = open1 + open2;
        int totalClose = close1 + close2;

        if (totalOpen != totalClose) {
            return "No";
        }

        boolean possible = isBalanced(s1, s2) || isBalanced(s2, s1);
        return possible ? "Yes" : "No";
    }

    private int countOpen(String s) {
        int count = 0;
        for (char c : s.toCharArray()) {
            if (c == '(') {
                count++;
            }
        }
        return count;
    }

    private boolean isBalanced(String first, String second) {
        int balance = 0;
        for (char c : first.toCharArray()) {
            if (c == '(') {
                balance++;
            } else {
                balance--;
            }
            if (balance < 0) {
                return false;
            }
        }
        for (char c : second.toCharArray()) {
            if (c == '(') {
                balance++;
            } else {
                balance--;
            }
            if (balance < 0) {
                return false;
            }
        }
        return balance == 0;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.match_parens(Arrays.asList("()(", ")")).equals("Yes"),
                s.match_parens(Arrays.asList(")", ")")).equals("No"),
                s.match_parens(Arrays.asList("(()(())", "())())")).equals("No"),
                s.match_parens(Arrays.asList(")())", "(()()(")).equals("Yes"),
                s.match_parens(Arrays.asList("(())))", "(()())((")).equals("Yes"),
                s.match_parens(Arrays.asList("()", "())")).equals("No"),
                s.match_parens(Arrays.asList("(()(", "()))()")).equals("Yes"),
                s.match_parens(Arrays.asList("((((", "((())")).equals("No"),
                s.match_parens(Arrays.asList(")(()", "(()(")).equals("No"),
                s.match_parens(Arrays.asList(")(", ")(")).equals("No")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

