class Solution {
    public List<Integer> get_odd_collatz(int n) {
        List<Integer> sequence = new ArrayList<>();
        int current = n;
        sequence.add(current);
        while (current != 1) {
            if (current % 2 == 0) {
                current = current / 2;
            } else {
                current = 3 * current + 1;
            }
            sequence.add(current);
        }

        List<Integer> odds = new ArrayList<>();
        for (int num : sequence) {
            if (num % 2 != 0) {
                odds.add(num);
            }
        }

        Collections.sort(odds);
        return odds;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.get_odd_collatz(5));  // Output: [1, 5]
        System.out.println(sol.get_odd_collatz(1));  // Output: [1]
        System.out.println(sol.get_odd_collatz(3));  // Output: [1, 3, 5]
    }
}

