class Solution {
    public Object split_words(String txt) {
        // Check if there are any whitespaces
        if (txt.contains(" ")) {
            // Split on one or more whitespaces
            String[] parts = txt.split("\\s+");
            List<String> result = new ArrayList<>();
            for (String part : parts) {
                if (!part.isEmpty()) {
                    result.add(part);
                }
            }
            return result.isEmpty() ? new ArrayList<String>() : result;
        }
        // Check if there are commas
        else if (txt.contains(",")) {
            // Split on commas
            String[] parts = txt.split(",");
            List<String> result = new ArrayList<>();
            for (String part : parts) {
                if (!part.isEmpty()) {
                    result.add(part);
                }
            }
            return result.isEmpty() ? new ArrayList<String>() : result;
        }
        // Otherwise, count lowercase letters with odd order
        else {
            int count = 0;
            for (char c : txt.toCharArray()) {
                if (Character.isLowerCase(c)) {
                    int ord = c - 'a';
                    if (ord % 2 != 0) {
                        count++;
                    }
                }
            }
            return count;
        }
    }

    public static void main(String[] args) {
        Solution sol = new Solution();

        // Test 1: Split on whitespace
        Object result1 = sol.split_words("Hello world!");
        List<String> expected1 = Arrays.asList("Hello", "world!");
        System.out.println("Test 1: " + (expected1.equals(result1) ? "Passed" : "Failed"));

        // Test 2: Split on commas
        Object result2 = sol.split_words("Hello,world!");
        List<String> expected2 = Arrays.asList("Hello", "world!");
        System.out.println("Test 2: " + (expected2.equals(result2) ? "Passed" : "Failed"));

        // Test 3: Count lowercase letters with odd order (abcdef -> 3)
        Object result3 = sol.split_words("abcdef");
        System.out.println("Test 3: " + (result3.equals(3) ? "Passed" : "Failed"));

        // Test 4: Mixed case letters (AbcDef) should count 2
        Object result4 = sol.split_words("AbcDef");
        System.out.println("Test 4: " + (result4.equals(2) ? "Passed" : "Failed"));

        // Test 5: Empty string
        Object result5 = sol.split_words("");
        System.out.println("Test 5: " + (result5.equals(0) ? "Passed" : "Failed"));

        // Test 6: Mixed whitespace and commas, split on whitespace
        Object result6 = sol.split_words("Hello, world! How,are you");
        List<String> expected6 = Arrays.asList("Hello,", "world!", "How,are", "you");
        System.out.println("Test 6: " + (expected6.equals(result6) ? "Passed" : "Failed"));

        // Test 7: String with commas and no whitespace (a,b,c)
        Object result7 = sol.split_words("a,b,c");
        List<String> expected7 = Arrays.asList("a", "b", "c");
        System.out.println("Test 7: " + (expected7.equals(result7) ? "Passed" : "Failed"));
    }
}

