class Solution {
    public String intersection(List<Integer> interval1, List<Integer> interval2) {
        int start1 = interval1.get(0);
        int end1 = interval1.get(1);
        int start2 = interval2.get(0);
        int end2 = interval2.get(1);

        int intersectStart = Math.max(start1, start2);
        int intersectEnd = Math.min(end1, end2);

        if (intersectStart > intersectEnd) {
            return "NO";
        }

        int length = intersectEnd - intersectStart;

        return isPrime(length) ? "YES" : "NO";
    }

    private boolean isPrime(int n) {
        if (n <= 1) {
            return false;
        }
        if (n == 2) {
            return true;
        }
        if (n % 2 == 0) {
            return false;
        }
        for (int i = 3; i * i <= n; i += 2) {
            if (n % i == 0) {
                return false;
            }
        }
        return true;
    }
}

