class Solution {
    public Optional<Integer> prod_signs(List<Integer> arr) {
        if (arr.isEmpty()) {
            return Optional.empty();
        }

        int sumMagnitudes = 0;
        int productSigns = 1;

        for (int num : arr) {
            sumMagnitudes += Math.abs(num);
            if (num > 0) {
                productSigns *= 1;
            } else if (num < 0) {
                productSigns *= -1;
            } else {
                productSigns *= 0;
            }
        }

        int result = sumMagnitudes * productSigns;
        return Optional.of(result);
    }

