class Solution {
    public List<Integer> tri(int n) {
        List<Integer> result = new ArrayList<>();
        if (n >= 0) {
            result.add(1); // tri(0)
            if (n >= 1) {
                result.add(3); // tri(1)
                for (int i = 2; i <= n; i++) {
                    if (i % 2 == 0) {
                        int val = 1 + i / 2;
                        result.add(val);
                    } else {
                        int prev1 = result.get(i - 1);
                        int prev2 = result.get(i - 2);
                        int term = (i + 3) / 2;
                        int val = prev1 + prev2 + term;
                        result.add(val);
                    }
                }
            }
        }
        return result;
    }

