class Solution {
    public boolean check_if_last_char_is_a_letter(String txt) {
        if (txt.isEmpty()) {
            return false;
        }
        char lastChar = txt.charAt(txt.length() - 1);
        if (!Character.isLetter(lastChar)) {
            return false;
