class Solution {
    public List<Integer> minPath(List<List<Integer>> grid, int k) {
        int n = grid.size();
        int minVal = Integer.MAX_VALUE;
        int startX = -1, startY = -1;

        // Find the cell with the minimum value to start
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                int val = grid.get(i).get(j);
                if (val < minVal) {
                    minVal = val;
                    startX = i;
                    startY = j;
                }
            }
        }

        // Directions: up, down, left, right
        int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};

        // Priority queue to keep track of paths sorted lexicographically
        PriorityQueue<PathNode> pq = new PriorityQueue<>((a, b) -> {
            for (int i = 0; i < a.path.size(); i++) {
                if (i >= b.path.size()) return 1;
                int cmp = a.path.get(i).compareTo(b.path.get(i));
                if (cmp != 0) return cmp;
            }
            return Integer.compare(a.path.size(), b.path.size());
        });

        // Initialize with the starting cell
        List<Integer> initialPath = new ArrayList<>();
        initialPath.add(grid.get(startX).get(startY));
        pq.add(new PathNode(startX, startY, initialPath));

        // Visited set to track paths of length l at position (x, y)
        Set<String> visited = new HashSet<>();

        while (!pq.isEmpty()) {
            PathNode current = pq.poll();

            // If the path length is k, return it
            if (current.path.size() == k) {
                return current.path;
            }

            // Generate all possible next steps
            for (int[] dir : dirs) {
                int newX = current.x + dir[0];
                int newY = current.y + dir[1];

                // Check if new position is within bounds
                if (newX >= 0 && newX < n && newY >= 0 && newY < n) {
                    List<Integer> newPath = new ArrayList<>(current.path);
                    newPath.add(grid.get(newX).get(newY));

                    // Check if the new path is still possible to be the smallest
                    String key = newX + "," + newY + "," + newPath.size();
                    if (!visited.contains(key)) {
                        visited.add(key);
                        pq.add(new PathNode(newX, newY, newPath));
                    }
                }
            }
        }

        // In case no path found (should not happen as per problem statement)
        return new ArrayList<>();
    }

    static class PathNode {
        int x, y;
        List<Integer> path;

        PathNode(int x, int y, List<Integer> path) {
            this.x = x;
            this.y = y;
            this.path = path;
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<List<Integer>> grid1 = Arrays.asList(
            Arrays.asList(1, 2, 3),
            Arrays.asList(4, 5, 6),
            Arrays.asList(7, 8, 9)
        );
        int k1 = 3;
        List<Integer> expected1 = Arrays.asList(1, 2, 1);
