class Solution {
    public String file_name_check(String file_name) {
        // Check number of dots
        String[] parts = file_name.split("\\.");
        if (parts.length != 2) {
            return "No";
        }

        // Check name part (before the dot)
        String namePart = parts[0];
        if (namePart.isEmpty()) {
            return "No";
        }
        if (!Character.isLetter(namePart.charAt(0))) {
            return "No";
        }

        // Check extension part
        String extension = parts[1];
        if (!extension.equals("txt") && !extension.equals("exe") && !extension.equals("dll")) {
            return "No";
        }

        // Check digit count
        int digitCount = 0;
        for (int i = 0; i < file_name.length(); i++) {
            if (Character.isDigit(file_name.charAt(i))) {
                digitCount++;
            }
        }
        if (digitCount > 3) {
            return "No";
        }

        return "Yes";
    }
}

