class Solution {
    public String fix_spaces(String text) {
        StringBuilder result = new StringBuilder();
        int i = 0;
        int n = text.length();
        while (i < n) {
            if (text.charAt(i) == ' ') {
                int j = i;
                while (j < n && text.charAt(j) == ' ') {
                    j++;
                }
                int count = j - i;
                if (count <= 2) {
                    for (int k = 0; k < count; k++) {
                        result.append('_');
                    }
                } else {
                    result.append('-');
                }
                i = j;
            } else {
                int j = i;
                while (j < n && text.charAt(j) != ' ') {
                    j++;
                }
                result.append(text.substring(i, j));
                i = j;
            }
        }
        return result.toString();
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        // Test cases
        System.out.println(sol.fix_spaces("Example").equals("Example")); // true
        System.out.println(sol.fix_spaces("Example 1").equals("Example_1")); // true
        System.out.println(sol.fix_spaces(" Example 2").equals("_Example_2")); // true
        System.out.println(sol.fix_spaces(" Example   3").equals("_Example-3")); // true
    }
}

