                Objects.equals(s.fix_spaces("Yellow Yellow  Dirty  Fellow" ), "Yellow_Yellow__Dirty__Fellow" ),
                Objects.equals(s.fix_spaces("Exa   mple" ), "Exa-mple" ),
                Objects.equals(s.fix_spaces("   Exa 1 2 2 mple" ), "-Exa_1_2_2_mple" )
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

