class Solution {
    public boolean simplify(String x, String n) {
        // Split x into numerator and denominator
        String[] xParts = x.split("/");
        BigInteger xNum = new BigInteger(xParts[0]);
        BigInteger xDen = new BigInteger(xParts[1]);

        // Split n into numerator and denominator
        String[] nParts = n.split("/");
        BigInteger nNum = new BigInteger(nParts[0]);
        BigInteger nDen = new BigInteger(nParts[1]);

        // Compute the product of numerators and denominators
        BigInteger productNum = xNum.multiply(nNum);
        BigInteger productDen = xDen.multiply(nDen);

        // Check if the product numerator is divisible by the product denominator
        return productNum.mod(productDen).equals(BigInteger.ZERO);
    }
}

