    public int sum_squares(List<Integer> lst) {
        int sum = 0;
        for (int i = 0; i < lst.size(); i++) {
            int num = lst.get(i);
            if (i % 3 == 0) {
                sum += num * num;
            } else if (i % 4 == 0) {
                sum += num * num * num;
            } else {
                sum += num;
            }
        }
        return sum;
    }

