class Solution {
    public String words_in_sentence(String sentence) {
        String[] words = sentence.split(" ");
        List<String> result = new ArrayList<>();
        for (String word : words) {
            int length = word.length();
            if (isPrime(length)) {
                result.add(word);
            }
        }
        return String.join(" ", result);
    }

    private boolean isPrime(int num) {
        if (num <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(num); i++) {
            if (num % i == 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution sol = new Solution();

        // Test cases
        String[][] testCases = {
            {"This is a test", "is"},
            {"lets go for swimming", "go for"},
            {"a", ""},
            {"I am", "am"},
            {"Testing", "Testing"},
            {"Hello world", "Hello world"},
            {"Hi there you", "Hi there you"},
            {"Prime numbers are cool", "are cool"}  // "Prime"(5), "numbers"(7), "are"(3), "cool"(4)
        };

        for (String[] testCase : testCases) {
            String input = testCase[0];
            String expected = testCase[1];
            String actual = sol.words_in_sentence(input);
            if (actual.equals(expected)) {
                System.out.println("Test passed for input: '" + input + "'");
            } else {
                System.out.println("Test failed for input: '" + input + "'");
                System.out.println("Expected: '" + expected + "'");
                System.out.println("Actual:   '" + actual + "'");
            }
        }
    }
}

