class Solution {
    public int get_max_triples(int n) {
        int c0 = 0;
        if (n >= 2) {
            c0 = (n - 2) / 3 + 1;
        }
        int c1 = n - c0;
        long comb0 = (long) c0 * (c0 - 1) * (c0 - 2) / 6;
        long comb1 = (long) c1 * (c1 - 1) * (c1 - 2) / 6;
        return (int) (comb0 + comb1);
    }
}

