class Solution {
    public List<Integer> order_by_points(List<Integer> nums) {
        if (nums.isEmpty()) {
            return new ArrayList<>();
        }
        List<Integer> indices = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            indices.add(i);
        }
        Collections.sort(indices, new Comparator<Integer>() {
            @Override
            public int compare(Integer i1, Integer i2) {
                int sum1 = sumDigits(nums.get(i1));
                int sum2 = sumDigits(nums.get(i2));
                if (sum1 != sum2) {
                    return Integer.compare(sum1, sum2);
                } else {
                    return Integer.compare(i1, i2);
                }
            }
        });
        List<Integer> result = new ArrayList<>();
        for (int index : indices) {
            result.add(nums.get(index));
        }
        return result;
    }

    private int sumDigits(int num) {
        if (num == 0) {
            return 0;
        }
        boolean isNegative = num < 0;
        num = Math.abs(num);
        List<Integer> digits = new ArrayList<>();
        while (num > 0) {
            digits.add(num % 10);
            num /= 10;
        }
        Collections.reverse(digits);
        int sum = 0;
        if (isNegative) {
            if (!digits.isEmpty()) {
                sum += -digits.get(0);
                for (int i = 1; i < digits.size(); i++) {
                    sum += digits.get(i);
                }
            }
        } else {
            for (int d : digits) {
                sum += d;
            }
        }
        return sum;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.order_by_points(new ArrayList<>(Arrays.asList(1, 11, -1, -11, -12))).equals(Arrays.asList(-1, -11, 1, -12, 11)),
