class Solution {
    public int specialFilter(List<Integer> nums) {
        int count = 0;
        for (Integer num : nums) {
            if (num <= 10) {
                continue;
            }
            int n = Math.abs(num);
            int last = n % 10;
            int first = n;
            while (first >= 10) {
                first /= 10;
            }
            if (last % 2 == 1 && first % 2 == 1) {
                count++;
            }
        }
        return count;
    }

