class Solution {
    public List<String> bf(String planet1, String planet2) {
        List<String> planets = Arrays.asList("Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune");
        int index1 = planets.indexOf(planet1);
        int index2 = planets.indexOf(planet2);
        if (index1 == -1 || index2 == -1) {
            return new ArrayList<>();
        }
        int lower = Math.min(index1, index2);
        int upper = Math.max(index1, index2);
        if (upper - lower <= 1) {
            return new ArrayList<>();
        }
        List<String> between = planets.subList(lower + 1, upper);
        return new ArrayList<>(between);
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.bf("Jupiter", "Neptune")); // ["Saturn", "Uranus"]
        System.out.println(sol.bf("Earth", "Mercury"));   // ["Venus"]
        System.out.println(sol.bf("Mercury", "Uranus"));  // ["Venus", "Earth", "Mars", "Jupiter", "Saturn"]
        System.out.println(sol.bf("Earth", "Pluto"));     // []
        System.out.println(sol.bf("Venus", "Earth"));     // []
        System.out.println(sol.bf("Earth", "Earth"));     // []
    }
}

