class Solution {
    public List<Integer> even_odd_count(int num) {
        int even = 0, odd = 0;
        num = Math.abs(num);
        do {
            int digit = num % 10;
            if (digit % 2 == 0) {
                even++;
            } else {
                odd++;
            }
            num /= 10;
        } while (num != 0);
        return Arrays.asList(even, odd);
    }
}

