class Solution {
    public boolean right_angle_triangle(int a, int b, int c) {
        if (a <= 0 || b <= 0 || c <= 0) {
            return false;
        }
        int[] sides = {a, b, c};
        Arrays.sort(sides);
        if (sides[0] + sides[1] <= sides[2]) {
            return false;
        }
        return (sides[0] * sides[0] + sides[1] * sides[1]) == (sides[2] * sides[2]);
    }

    public static void main(String[] args) {
        Solution sol = new Solution();
        System.out.println(sol.right_angle_triangle(3, 4, 5));    // true
        System.out.println(sol.right_angle_triangle(1, 2, 3));    // false
        System.out.println(sol.right_angle_triangle(5, 12, 13));  // true
        System.out.println(sol.right_angle_triangle(6, 8, 10));    // true
        System.out.println(sol.right_angle_triangle(0, 0, 0));    // false
        System.out.println(sol.right_angle_triangle(2, 3, 4));     // false
        System.out.println(sol.right_angle_triangle(5, 5, 5));     // false
        System.out.println(sol.right_angle_triangle(5, 3, 4));    // true
        System.out.println(sol.right_angle_triangle(1, 1, 2));     // false
    }
}

