class Solution {
    public String find_max(List<String> words) {
        int maxUnique = -1;
        String result = "";
        for (String word : words) {
            Set<Character> uniqueChars = new HashSet<>();
            for (char c : word.toCharArray()) {
                uniqueChars.add(c);
            }
            int currentCount = uniqueChars.size();
            if (currentCount > maxUnique) {
                maxUnique = currentCount;
                result = word;
            } else if (currentCount == maxUnique) {
                if (word.compareTo(result) < 0) {
                    result = word;
                }
            }
        }
        return result;
    }

    public static void main(String[] args) {
