class Solution {
    public Optional<String> string_to_md5(String text) throws NoSuchAlgorithmException {
        if (text.isEmpty()) {
            return Optional.empty();
        }
        MessageDigest md = MessageDigest.getInstance("MD5");
        byte[] digest = md.digest(text.getBytes());
        BigInteger num = new BigInteger(1, digest);
        String hash = String.format("%032x", num);
        return Optional.of(hash);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        try {
            // Test case 1: "Hello world"
            String input1 = "Hello world";
            Optional<String> result1 = solution.string_to_md5(input1);
            String expected1 = "3e25960a79dbc69b674cd4ec67a72c62";
            assertResult("Test 1", expected1, result1);

            // Test case 2: empty string
            Optional<String> result2 = solution.string_to_md5("");
            assert result2.isEmpty() : "Test 2 failed: Expected empty Optional.";
            System.out.println("Test 2 passed.");

            // Test case 3: "abc"
            String input3 = "abc";
            Optional<String> result3 = solution.string_to_md5(input3);
            String expected3 = "900150983cd24fb0d6963f7d28e17f72";
            assertResult("Test 3", expected3, result3);

        } catch (NoSuchAlgorithmException e) {
            System.err.println("MD5 algorithm not available.");
            e.printStackTrace();
        }
    }

    private static void assertResult(String testName, String expected, Optional<String> actual) {
        if (actual.isPresent() && actual.get().equals(expected)) {
            System.out.println(testName + " passed.");
        } else {
            System.out.println(testName + " failed. Expected: " + expected + ", Got: " + actual.orElse("empty"));
        }
    }
}

