class Solution {
    public int do_algebra(List<String> operator, List<Integer> operand) {
        // Generate tokens list
        List<Object> tokens = new ArrayList<>();
        int n = operator.size();
        for (int i = 0; i < n; i++) {
            tokens.add(operand.get(i));
            tokens.add(operator.get(i));
        }
        tokens.add(operand.get(n)); // operand has n+1 elements

        // Convert to postfix
        List<Object> postfix = infixToPostfix(tokens);

        // Evaluate postfix
        return evaluatePostfix(postfix);
    }

    private List<Object> infixToPostfix(List<Object> tokens) {
        Stack<String> stack = new Stack<>();
        List<Object> postfix = new ArrayList<>();

        for (Object token : tokens) {
            if (token instanceof Integer) {
                postfix.add(token);
            } else {
                String op = (String) token;
                while (!stack.isEmpty() && hasHigherPrecedence(stack.peek(), op)) {
                    postfix.add(stack.pop());
                }
                stack.push(op);
            }
        }

        while (!stack.isEmpty()) {
            postfix.add(stack.pop());
        }

        return postfix;
    }

    private boolean hasHigherPrecedence(String stackOp, String currentOp) {
        int stackPrec = getPrecedence(stackOp);
        int currentPrec = getPrecedence(currentOp);

        if (stackPrec > currentPrec) {
            return true;
        } else if (stackPrec == currentPrec) {
            return !isRightAssociative(currentOp);
        } else {
            return false;
        }
    }

    private int getPrecedence(String op) {
        switch (op) {
            case "**":
                return 4;
            case "*":
            case "/":
                return 3;
            case "+":
            case "-":
                return 2;
            default:
                throw new IllegalArgumentException("Unknown operator: " + op);
        }
    }

    private boolean isRightAssociative(String op) {
        return op.equals("**");
    }

    private int evaluatePostfix(List<Object> postfix) {
        Stack<Integer> stack = new Stack<>();

        for (Object token : postfix) {
            if (token instanceof Integer) {
                stack.push((Integer) token);
            } else {
                String op = (String) token;
                int b = stack.pop();
                int a = stack.pop();
                int result = applyOp(a, b, op);
                stack.push(result);
            }
        }

        return stack.pop();
    }

    private int applyOp(int a, int b, String op) {
        switch (op) {
            case "+":
                return a + b;
            case "-":
                return a - b;
            case "*":
                return a * b;
            case "/":
                return a / b;
            case "**":
                return (int) Math.pow(a, b);
            default:
                throw new IllegalArgumentException("Unknown operator: " + op);
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.do_algebra(new ArrayList<>(Arrays.asList("**", "*", "+")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 37,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "*", "-")), new ArrayList<>(Arrays.asList(2, 3, 4, 5))) == 9,
                s.do_algebra(new ArrayList<>(Arrays.asList("/", "*")), new ArrayList<>(Arrays.asList(7, 3, 4))) == 8,
                s.do_algebra(new ArrayList<>(Arrays.asList("+", "**", "**")), new ArrayList<>(Arrays.asList(7, 5, 3, 2))) == 1953132
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.util.*;

class Solution {
    public boolean below_zero(List<Integer> operations) {
        int balance = 0;
        for (int op : operations) {
            balance += op;
            if (balance < 0) {
                return true;
            }
        }
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: All positive operations
        List<Integer> test1 = Arrays.asList(1, 2, 3);
        System.out.println(solution.below_zero(test1) == false ? "Test 1 Passed" : "Test 1 Failed");

        // Test case 2: Operations causing negative balance
        List<Integer> test2 = Arrays.asList(1, 2, -4, 5);
        System.out.println(solution.below_zero(test2) == true ? "Test 2 Passed" : "Test 2 Failed");

        // Test case 3: Single negative operation
        List<Integer> test3 = Arrays.asList(-1);
        System.out.println(solution.below_zero(test3) == true ? "Test 3 Passed" : "Test 3 Failed");

        // Test case 4: Balance reaches zero but not negative
        List<Integer> test4 = Arrays.asList(3, -3);
        System.out.println(solution.below_zero(test4) == false ? "Test 4 Passed" : "Test 4 Failed");

        // Test case 5: Negative balance in the middle of operations
        List<Integer> test5 = Arrays.asList(5, -3, -3);
        System.out.println(solution.below_zero(test5) == true ? "Test 5 Passed" : "Test 5 Failed");

        // Test case 6: Empty list of operations
        List<Integer> test6 = Collections.emptyList();
        System.out.println(solution.below_zero(test6) == false ? "Test 6 Passed" : "Test 6 Failed");
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.below_zero(new ArrayList<>(Arrays.asList())),
                !s.below_zero(new ArrayList<>(Arrays.asList(1, 2, -3, 1, 2, -3))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, 2, -4, 5, 6))),
                !s.below_zero(new ArrayList<>(Arrays.asList(1, -1, 2, -2, 5, -5, 4, -4))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, -1, 2, -2, 5, -5, 4, -5))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, -2, 2, -2, 5, -5, 4, -4)))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

import java.math.BigInteger;
import java.util.stream.Collectors;
import java.security.*;
import java.util.*;
import java.lang.*;
import java.util.*;

class Solution {
    public List<String> separate_paren_groups(String paren_string) {
        List<String> result = new ArrayList<>();
        String s = paren_string.replaceAll(" ", "");
        int balance = 0;
        int start = 0;
        for (int i = 0; i < s.length(); i++) {
            char c = s.charAt(i);
            if (c == '(') {
                balance++;
            } else {
                balance--;
            }
            if (balance == 0) {
                result.add(s.substring(start, i + 1));
                start = i + 1;
            }
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        testCase1(solution);
        testCase2(solution);
        testCase3(solution);
        testCase4(solution);
        testCase5(solution);
    }

    private static void testCase1(Solution solution) {
        String input = "( ) (( )) (( )( ))";
        List<String> expected = Arrays.asList("()", "(())", "(()())");
        List<String> actual = solution.separate_paren_groups(input);
        System.out.println("Test Case 1: " + checkResult(expected, actual));
    }

    private static void testCase2(Solution solution) {
        String input = "";
        List<String> expected = new ArrayList<>();
        List<String> actual = solution.separate_paren_groups(input);
        System.out.println("Test Case 2: " + checkResult(expected, actual));
    }

    private static void testCase3(Solution solution) {
        String input = "((()))";
        List<String> expected = Arrays.asList("((()))");
        List<String> actual = solution.separate_paren_groups(input);
        System.out.println("Test Case 3: " + checkResult(expected, actual));
    }

    private static void testCase4(Solution solution) {
        String input = "   (() )  ( ()() )   ";
        List<String> expected = Arrays.asList("(())", "(()())");
        List<String> actual = solution.separate_paren_groups(input);
        System.out.println("Test Case 4: " + checkResult(expected, actual));
    }

    private static void testCase5(Solution solution) {
        String input = "()(())";
        List<String> expected = Arrays.asList("()", "(())");
        List<String> actual = solution.separate_paren_groups(input);
        System.out.println("Test Case 5: " + checkResult(expected, actual));
    }

    private static String checkResult(List<String> expected, List<String> actual) {
        return expected.equals(actual) ? "Passed" : "Failed. Expected: " + expected + ", Actual: " + actual;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.separate_paren_groups("(()()) ((())) () ((())()())").equals(Arrays.asList(
                        "(()())", "((()))", "()", "((())()())"
                )),
                s.separate_paren_groups("() (()) ((())) (((())))").equals(Arrays.asList(
                        "()", "(())", "((()))", "(((())))"
                )),
                s.separate_paren_groups("(()(())((())))").equals(Arrays.asList(
                        "(()(())((())))"
                )),
                s.separate_paren_groups("( ) (( )) (( )( ))").equals(Arrays.asList("()", "(())", "(()())"))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}
